import { Nav } from "./Nav"
import { Header } from "./Header"
import { Educationals } from "./Educationals"
import { PersonalInfo } from "./PersonalInfo"
// import { Contact } from "./Contact"
// import { Projects } from "./Projects"
// import { LandingPage } from "./LandingPage"
// import { Footer } from "./Footer"

import reactLogo from "./img/logo512.png"
import React from "react"

function App() {

  const techArray = []

  const createTechInfoObj = (techName, techDescription, techUrl, techImg, techAlt) => ({
    key: techName,
    name: techName,
    description: techDescription,
    url: techUrl,
    img: techImg,
    alt: techAlt
})

const react = createTechInfoObj("React.js", "tech description", "", reactLogo, "React.js Logo")
techArray.push(react)

const javascript = createTechInfoObj("javascript", "tech description", "", reactLogo, "javascript Logo")
techArray.push(javascript)

const gitandgithub = createTechInfoObj("Git & Github", "tech description", "", reactLogo, "Git & Github Logo")
techArray.push(gitandgithub)

  return ([
    <Nav />,
    <Header />,
    <PersonalInfo />,
    <Educationals techArray={techArray}/>,
    /*
    <Contact />,
    <Projects />,
    <LandingPage />,
    <Footer />,*/
    ])
}

export { App }
